import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 41.1-5 Circuit courts authorized to dispose of waste and unappropriated lands.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/41.1-5.md","filePath":"vacode/41.1-5.md"}'),o={name:"vacode/41.1-5.md"},i=t('<h1 id="§-41-1-5-circuit-courts-authorized-to-dispose-of-waste-and-unappropriated-lands" tabindex="-1">§ 41.1-5 Circuit courts authorized to dispose of waste and unappropriated lands. <a class="header-anchor" href="#§-41-1-5-circuit-courts-authorized-to-dispose-of-waste-and-unappropriated-lands" aria-label="Permalink to &quot;§ 41.1-5 Circuit courts authorized to dispose of waste and unappropriated lands.&quot;">​</a></h1><p>The circuit courts of the counties and cities in which waste and unappropriated lands are alleged to lie are vested with authority to sell and dispose thereof in proceedings brought under §§ <a href="http://law.lis.virginia.gov/vacode/41.1-16/" target="_blank" rel="noreferrer">41.1-16</a> through <a href="http://law.lis.virginia.gov/vacode/41.1-20/" target="_blank" rel="noreferrer">41.1-20</a>; however, no sale or disposition shall be made of lands mentioned in § <a href="http://law.lis.virginia.gov/vacode/28.2-1200/" target="_blank" rel="noreferrer">28.2-1200</a> or of lands as to which a grant could not have been issued by the Librarian of Virginia under § <a href="http://law.lis.virginia.gov/vacode/41.1-3/" target="_blank" rel="noreferrer">41.1-3</a>.</p><p>Code 1950, § 41-8.2; 1952, c. 185; 1970, c. 291; 1991, c. 378; 1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0850" target="_blank" rel="noreferrer">850</a>; 1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0427" target="_blank" rel="noreferrer">427</a>.</p>',3),n=[i];function s(d,c,l,p,h,u){return a(),r("div",null,n)}const g=e(o,[["render",s]]);export{f as __pageData,g as default};
